script: |
  super -f text -I q1667.spq | sort > q1667.out

inputs:
  - name: q1667.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 + col0 NOT IN ( - col0, col0 * - col1 * - - 17 + - + col1, - + 24 * - - col1 + 1 + - - col2, col1, + col0 - + 64, + 49, + + col2 );
  - name: tab2

outputs:
  - name: q1667.out
    data: |
